import { Component } from 'react';
import { Text, View } from 'react-native';
import { TextInput } from 'react-native-web';

class App extends Component {
  render() {
    return (
      <View>
        <Text>Abertura de Conta</Text>

        <div className='campos'>
          <Text>Nome:</Text>
          <TextInput/>
        </div>
      </View>
    )
  }
}

export default App;
